import React from 'react';

const PricePlansTab = () => {
  return (
    <div className='profile__info'>
      <h3 className='profile__name'>Eraly Stefan</h3>
      <span className='profile__address'>Rm. Aksy, Jalal - Abad</span>{' '}
      <span className='profile__gmt'>4:32PM (GMT-4)</span>
    </div>
  );
};

export default PricePlansTab;
